//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/LinkTokenInterface.sol";
import "@chainlink/contracts/src/v0.8/interfaces/VRFCoordinatorV2Interface.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBaseV2.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract RNGCalculator is VRFConsumerBaseV2, Ownable {
  VRFCoordinatorV2Interface private COORDINATOR;
  LinkTokenInterface private LINKTOKEN;

  // VRF parameters
  address private vrfCoordinator;
  address private linkTokenAddress;
  bytes32 private keyHash;
  uint32 private callbackGasLimit = 100000;
  uint16 private requestConfirmations = 3;

  // Storage parameters
  uint256[] public randomWord;
  uint256 public requestId;
  uint64 public subscriptionId;

  constructor(
    address _vrfCoordinator,
    address _linkTokenAddress,
    bytes32 _keyHash
  ) VRFConsumerBaseV2(_vrfCoordinator) {
    vrfCoordinator = _vrfCoordinator;
    linkTokenAddress = _linkTokenAddress;
    keyHash = _keyHash;
    COORDINATOR = VRFCoordinatorV2Interface(vrfCoordinator);
    LINKTOKEN = LinkTokenInterface(linkTokenAddress);
    //Create a new subscription when you deploy the contract.
    createNewSubscription();
  }

  // Create a new subscription when the contract is initially deployed.
  function createNewSubscription() private onlyOwner {
    // Create a subscription with a new subscription ID.
    address[] memory consumers = new address[](1);
    consumers[0] = address(this);
    subscriptionId = COORDINATOR.createSubscription();
    // Add this contract as a consumer of its own subscription.
    COORDINATOR.addConsumer(subscriptionId, consumers[0]);
  }

  // Assumes the subscription is funded sufficiently.
  function requestRandomWords() external onlyOwner {
    // Will revert if subscription is not set and funded.
    requestId = COORDINATOR.requestRandomWords(
      keyHash,
      subscriptionId,
      requestConfirmations,
      callbackGasLimit,
      1
    );
  }

  function fulfillRandomWords(
    uint256,
    /* requestId */
    uint256[] memory _randomWord
  ) internal override {
    randomWord = _randomWord;
  }

  // ======================== Utility Functions ================================

  /**
   * @notice Tops up LINK balance of the contract
   * @param _amount The amount of LINK to top up (1000000000000000000 = 1 LINK)
   */
  function topUpSubscription(uint256 _amount) external onlyOwner {
    LINKTOKEN.transferAndCall(
      address(COORDINATOR),
      _amount,
      abi.encode(subscriptionId)
    );
  }

  /**
   * @notice Adds a consumer contract to the subscription
   * @param _consumerAddress The address of the consumer to add
   */
  function addConsumer(address _consumerAddress) external onlyOwner {
    COORDINATOR.addConsumer(subscriptionId, _consumerAddress);
  }

  /**
   * @notice Removes a consumer contract from the subscription
   * @param _consumerAddress The address of the consumer to remove
   */
  function removeConsumer(address _consumerAddress) external onlyOwner {
    COORDINATOR.removeConsumer(subscriptionId, _consumerAddress);
  }

  /**
   * Cancels the subscription and send the remaining LINK to a wallet address
   * @param _receivingWallet The address of the wallet that receives
   * the remaining LINK
   */
  function cancelSubscription(address _receivingWallet) external onlyOwner {
    COORDINATOR.cancelSubscription(subscriptionId, _receivingWallet);
    subscriptionId = 0;
  }

  /**
   * @notice Transfer this contract's LINK funds to an address.
   * @param _to The address of the address to send LINK to
   * @param _amount The amount of LINK to withdraw (1000000000000000000 = 1 LINK)
   */
  function withdraw(address _to, uint256 _amount) external onlyOwner {
    LINKTOKEN.transfer(_to, _amount);
  }
}

